import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import { Pagination, Navigation } from 'swiper/modules';

// Import Swiper styles
import 'swiper/css';

const Demo = () => {
  return (
    <>
      <Swiper
        pagination={{ type: 'progressbar' }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          <ul>
            <li>tea</li>
            <li>rum</li>
          </ul>
        </SwiperSlide>
        <SwiperSlide>
          <ul>
            <li>Item 1</li>
            <li>Item 2</li>
          </ul>
        </SwiperSlide>
        {/* Add more SwiperSlides with your content */}
      </Swiper>
    </>
  );
};

export default Demo;
